import React, { Component} from 'react';
import { Route, Routes } from 'react-router-dom';
import Main from '../../components/Main/Main'
import Auto from '../../pages/Auto/Auto'
import Laboratory from '../../pages/Laboratory/Laboratory';
import PrepodRedLab from '../../pages/PrepodRedLab/PrepodRedLab';
import Registration from '../../pages/Registration/Registration';
import { AuthProvider, useAuth } from '../../components/AuthContext';

const MainRouter = () => {
  return ( 
    <Routes>
          <Route path="/" element={<Main />} />
          <Route path="login" element={<Auto />} />
          <Route path="Laboratory" role="teacher" element={<Laboratory />} />
          <Route path="editingLaboratoryPrep" role="teacher" element={<PrepodRedLab />} />
          <Route path="Registration" element={<Registration/>}/>
          <Route from='/' to="/login"></Route>
    </Routes> 
  );
}

const PrivatRoute = ({component: Component, role, ...rest}) => {
  const {useRole} = useAuth();
  return (
    <Route
      {...rest}
      render={(props) =>
        userRole === role ? <Component {...props} /> : <Redirect to="/login" />
      }
    />
  );
}

export default MainRouter;
